        {
            this.colorCode = colorCode;
            this.rom = rom;
            this.different = false;
        }
        public ColorChoiceHair(bool different, ROM rom)
        {
            this.rom = rom;
            this.different = different;

            currentBrightDixieHair = Form1.backupColorDixieBrightHair;
            currentRegDixieHair = Form1.backupColorDixieRegHair;
            currentDimDixieHair = Form1.backupColorDixieDimHair;


        }

        public void Apply(int index)
        {
            // Have we been here before?
            if (!visited)
            {
                // Apply default
                ASM.ApplyPatch(defaultAddresses, defaultValues, rom.rom);
                visited = true;
            }

            if (different)
            {
                return;
            }
            else
            {
                int r = colorCode[0], g = colorCode[1], b = colorCode[2], r2, g2, b2;

                // Apply regular
                AddColorToROM(Defaults.dixiePal, r, g, b, index);
                // Apply dim
                AddColorToROM(Defaults.dixieDimPal, r, g, b, index, "Dim");
                // Apply light
                AddColorToROM(Defaults.dixieLightPal, r, g, b, index, "Light");

            }

        }


