                g = (g + 3 > 0x1f ? 0x1f : g + 3);
                b = (b + 3 > 0x1f ? 0x1f : b + 3);
                AddColorToROM(address, r, g, b, index);

                return;
            }
        }
        //ef,01,23 hair
        private void AddColorToROM(int address, int r, int g, int b, int index)
        {
            // 89 is brightest. no mod
            // Calculate number to add
            int toAdd23 = (r << 0) | (g << 5) | (b << 10);
            rom.Write16(address + index - 0, toAdd23);

            // 67 is one step down
            r = (r - 3 < 0 ? 0 : r - 3);
            g = (g - 3 < 0 ? 0 : g - 3);
            b = (b - 3 < 0 ? 0 : b - 3);
            int toAdd01 = (r << 0) | (g << 5) | (b << 10);
            rom.Write16(address + index - 2, toAdd01);

            // 45 is one step down
            r = (r - 3 < 0 ? 0 : r - 3);
            g = (g - 3 < 0 ? 0 : g - 3);
            b = (b - 3 < 0 ? 0 : b - 3);
            int toAddef = (r << 0) | (g << 5) | (b << 10);
            rom.Write16(address + index - 4, toAddef);
        }





        public void SaveColors(int index)
        {
            // Have we been here before?
            if (!visited)
            {
                visited = true;
            }

            if (different)
            {
                return;
            }
            else
            {
                int r = colorCode[0], g = colorCode[1], b = colorCode[2], r2, g2, b2;

                // Apply regular
                AddColor(Defaults.dixiePal, r, g, b, index);
                // Apply dim
                AddColor(Defaults.dixieDimPal, r, g, b, index, "Dim");
                // Apply light
                AddColor(Defaults.dixieLightPal, r, g, b, index, "Light");

            }

        }


        private void AddColor(int address, int r, int g, int b, int index, string mod)
        {
            if (mod == "dim")
            {
                // Change our base color
                r = (r - 3 < 0 ? 0 : r - 3);
                g = (g - 3 < 0 ? 0 : g - 3);
                b = (b - 3 < 0 ? 0 : b - 3);
                AddColor(address, r, g, b, index);
                return;
            }
            else
            {
                // Light
                // Change our base color
                r = (r - 3 < 0 ? 0 : r - 3);
                g = (g - 3 < 0 ? 0 : g - 3);
                b = (b - 3 < 0 ? 0 : b - 3);
                AddColor(address, r, g, b, index);

                return;
            }
        }


        private void AddColor(int address, int r, int g, int b, int index)
        {
            // Calculate number to add
            currentBrightDixieHair = Color.FromArgb(r << 3, g << 3, b << 3);

            r = (r - 3 < 0 ? 0 : r - 3);
            g = (g - 3 < 0 ? 0 : g - 3);
            b = (b - 3 < 0 ? 0 : b - 3);
            currentRegDixieHair = Color.FromArgb(r << 3, g << 3, b << 3);

            r = (r - 3 < 0 ? 0 : r - 3);
            g = (g - 3 < 0 ? 0 : g - 3);
            b = (b - 3 < 0 ? 0 : b - 3);
            currentDimDixieHair = Color.FromArgb(r << 3, g << 3, b << 3);

        }


        public static void ChangeHeadColor(List<byte> rom)
        {
            var romArray = rom;

            var x = romArray[Defaults.diddyPal];
            var y = romArray[Defaults.diddyPal + 0x19];

            // Diddy
            romArray[Defaults.headPal + 0x18] = romArray[Defaults.diddyPal + 0x18];
            romArray[Defaults.headPal + 0x19] = romArray[Defaults.diddyPal + 0x19];
            romArray[Defaults.headPal + 0x16] = romArray[Defaults.diddyPal + 0x16];
            romArray[Defaults.headPal + 0x17] = romArray[Defaults.diddyPal + 0x17];

            // Dixie
            romArray[Defaults.headPal + 0x10] = romArray[Defaults.dixiePal + 0x18];
            romArray[Defaults.headPal + 0x11] = romArray[Defaults.dixiePal + 0x19];
            romArray[Defaults.headPal + 0xe] = romArray[Defaults.dixiePal + 0x16];
            romArray[Defaults.headPal + 0xf] = romArray[Defaults.dixiePal + 0x17];



        }
        // Getter  methods
        public Color GetColorBrightDixieHair() => currentBrightDixieHair;
        public Color GetColorRegDixieHair() => currentRegDixieHair;
        public Color GetColorDimDixieHair() => currentDimDixieHair;

        // Setter  methods
        public Color SetColorBrightDixieHair(Color setColor) => currentBrightDixieHair = setColor;
        public Color SetColorRegDixieHair(Color setColor) => currentRegDixieHair = setColor;
        public Color SetColorDimDixieHair(Color setColor) => currentDimDixieHair = setColor;


